const Location = () => {
  var FLICKR_API_KEY = '248220c73c6bb9b90f93c50e077719cf'
  var location = new Flickr(process.env.FLICKR_API_KEY);

  location.photos.geo.getLocation({
    photo_id: 25825763
  }).then(function (res) {
    console.log('yay!', res.body);
  }).catch(function (err) {
    console.error('bonk', err);
  });
}

export default Location
